// Get a single DOM element by its id or multiple elements by class name
function E(id) { return document.getElementById(id); }
function cE(className) { return document.getElementsByClassName(className); }
function tE(tagName) { return document.getElementsByTagName(tagName); }
// Create an element, assign class, id, and style attributes, and then return that element
function gE(type, className, id, style) {
  var element = document.createElement(type);
  var attributes = [['class', className], ['id', id], ['style', style]];
  for ( i = 0; i < 3; i++ ) { element.setAttribute(attributes[i][0], attributes[i][1]) } return element; }
// Dimensions of the inner window (width and height)
var w = {};
function getWindowDimensions() { w['Height'] = window.innerHeight; w['Width'] = window.innerWidth; }
// Check to see if jQuery is present, used for properly calling VelocityJS
function jqueryVelocityCheck() { if (window.jQuery) { Velocity = $.Velocity; } else { Velocity = Velocity; } }
// Remove all children of a specific element
function removeAllElements(element) { while (element.firstChild) { element.removeChild(element.firstChild); } }
// Record the current page according to the ID tagged onto the .wrapper div found on each page and store it in a hash
var p = {}; function recCurrPage() { p['Current'] = cE('wrapper')[0].id; }
// Add and Remove a class from an item
function addC(item, className) { item.classList.add(className) }
function remC(item, className) { item.classList.remove(className) }
// Adds and Removes a class with a time-delay
function delayAddC(item, className, delay) { var timeout = window.setTimeout(function() { addC(item, className); }, delay); }
function delayRemC(item, className, delay) { var timeout = window.setTimeout(function() { remC(item, className); }, delay); }
// Run BOTH e.preventDefault and e.stopPropagation
function stopE(e) { e.stopPropagation; e.preventDefault; }
// Get/Set attributes prefixed with 'data'
function gA(item, att) { return item.getAttribute('data-'+att+''); }
function sA(item, attName, att) { item.setAttribute('data-'+attName+'', att); }
// Run a function within scriptInit.js using the global window object
function run(func, params) { window[func](params); }
// Force an event to fire
function fireEvent(element, event) {
  if (document.createEventObject) {
    // dispatch for IE
    var evt = document.createEventObject();
    return element.fireEvent('on'+event,evt)
  }
  else{
    // dispatch for firefox + others
    var evt = document.createEvent("HTMLEvents");
    evt.initEvent(event, true, true ); // event type,bubbling,cancelable
    return !element.dispatchEvent(evt);
  }
}

////////////////////////////////////////////////////////////////// Function Key
//-----------------------------------------------------------------------------
var func = {
  flashNOTICE: 'flashNOTICE',
  listFilter: 'listFilter',
  showdownINIT: 'showdownINIT',
  markdown: 'markdown',
  highlightCATEGORIES: 'highlightCATEGORIES',
  nameFILL: 'nameFILL',
  uploadImagePREVIEW: 'uploadImagePREVIEW',
  itemACTION: 'itemACTION',
  sectionTOGGLE: 'sectionTOGGLE'
}

///////////////////////////////////////////////////////////////////// Functions
//-----------------------------------------------------------------------------
function flashNOTICE() {
  var notice = E('flashNOTICE'),
      countdown = cE('countdown'),
      num = 3,
      flash = false,
      i = 0,
      timer = null;

  if (notice) {
    delayAddC(notice, 'active', 250);
    timer = window.setTimeout(function() {
      remC(notice, 'active');
      clearTimeout(timer);
    }, 3000);
  }
}

function showdownINIT() {
  showdown.extension('divClass', function () {
    var x = 0;
    var ext = {
      type: 'lang',
      filter: function(text, converter, options) {
        var classNAMES = text.match(/\[(.*)--]/g),
            newText = text;
        if ((x < 3) && (classNAMES != null)) {
          ++x;
          for (var i = 0; i < classNAMES.length; i++) {
            var classNAME = classNAMES[i].match(/\[(.*)--]/)[1];
            if (classNAME != '') {
              var regex = new RegExp("\\["+classNAME+"--]([\\s\\S]*)\\[--"+classNAME+"]"),
                  textSPLIT = newText.match(regex);
              if (textSPLIT != null) {
                var textSNIPPET = textSPLIT[1],
                    html = showdownCONVERT.makeHtml(textSNIPPET);
                newText = newText.replace(regex, '<div class="'+classNAME+'">'+html+'</div>');
              }
            }
          }
        }
        x = 0;
        return newText;
      }
    };
    return [ext];
  });

  showdownCONVERT = new showdown.Converter({
    extensions: ['divClass'],
    disableForced4SpacesIndentedSublists: true
  });
}

function listFilter(page) {
  var options = {
    valueNames: ['herbName', 'herbLatinName', 'draftStatus']
  };
  var hackerList = new List(page, options);
}

function markdown() {
  var textarea = E('leftPANEL').getElementsByTagName('textarea')[0],
      previewTEXT = E('previewTEXT'),
      text = textarea.innerHTML,
      html = showdownCONVERT.makeHtml(text);

  previewTEXT.innerHTML = html;
  textarea.oninput = function() { previewTEXT.innerHTML = showdownCONVERT.makeHtml(textarea.value); }
}

function highlightCATEGORIES() {
  categoryCHECKBOXES = cE('checkbox'),
  categories = JSON.parse(gA(cE('checkboxCONTAINER')[0], 'categories'));

  for (var i = 0; i < categories.length; i++) {
    var num = categories[i];
    for (var j = 0; j < categoryCHECKBOXES.length; j++) {
      var checkbox = categoryCHECKBOXES[j],
          id = gA(categoryCHECKBOXES[j], 'id');
      if (id == num) { checkbox.checked = true; }
    }
  }
}

function nameFILL() {
  var nameINPUT = E('name'),
      namePREVIEW = E('herbNAME'),
      sciNameINPUT = E('latin_name'),
      sciNamePREVIEW = E('herbLatinNAME');

  if (nameINPUT.value != '') { namePREVIEW.innerHTML = nameINPUT.value; }
  else { namePREVIEW.innerHTML = nameINPUT.placeholder; }

  if (sciNameINPUT.value != '') { sciNamePREVIEW.innerHTML = sciNameINPUT.value; }
  else { sciNamePREVIEW.innerHTML = sciNameINPUT.placeholder; }

  nameINPUT.oninput = function() { namePREVIEW.innerHTML = nameINPUT.value; }
  sciNameINPUT.oninput = function() { sciNamePREVIEW.innerHTML = sciNameINPUT.value; }
}

function uploadImagePREVIEW() {
  var inputs = document.querySelectorAll("input[type=file]"),
      previews = cE('imagePreviewCONTAINER');

  function displayIMG(input, num) {
    var reader = new FileReader(),
        preview = previews[num];
    if (input.files && input.files[0]) {
      reader.onload = function (e) {
        var image = new Image();
        image.src = e.target.result;
        image.onload = function() {
          preview.setAttribute('src', e.target.result);
          addC(preview, 'active');
        }
      }
      reader.readAsDataURL(input.files[0]);
    }
  }

  for (var i = 0; i < inputs.length; i++) {
    inputs[i].onchange = function() {
      var num = gA(this, 'num');
      displayIMG(this, num);
    }
  }
}

function itemACTION(controller) {
  var deleteB = E('deleteB'),
      saveB = E('submitB'),
      warningB = E('warningB'),
      loadingCONTAINER = cE('loading')[0],
      cancelWarningB = E('cancelWarningB'),
      warningCONTAINER = cE('warning')[0];

  if (deleteB) {
    warningB.onclick = function() { addC(warningCONTAINER, 'active'); }
    cancelWarningB.onclick = function() { remC(warningCONTAINER, 'active'); }

    deleteB.onclick = function() {
      addC(loadingCONTAINER, 'active');
      $.ajax({
        url: '/'+controller+'/'+gA(this, 'slug')+'',
        type: 'DELETE',
        beforeSend: function(xhr) {xhr.setRequestHeader('X-CSRF-Token', $('meta[name="csrf-token"]').attr('content'))},
        success: function(response) {
          window.location.href = '/admin/'+controller+'';
        }
      });
    }
  }

  saveB.onclick = function() {
    addC(this, 'active');
  }
}

function sectionTOGGLE() {
  var referencesCONTAINER = cE('references')[0],
      referencesB = referencesCONTAINER.firstElementChild,
      stat = false;

  referencesB.onclick = function() {
    if (!stat) {
      addC(referencesCONTAINER, 'active');
      stat = true;
    } else {
      remC(referencesCONTAINER, 'active');
      stat = false;
    }
  }
}

















//

//////////////////////////////////// Code execution and execution order control
//-----------------------------------------------------------------------------
function Engage() {
  run(func.flashNOTICE);
  switch (p.Current) {
    case 'herbsINDEX':
      run(func.listFilter, 'herbsINDEX');
      break;
    case 'herbNEW':
      run(func.showdownINIT);
      run(func.markdown);
      run(func.nameFILL);
      run(func.uploadImagePREVIEW);
      run(func.itemACTION, 'herbs'); // delete or save Herb or Category
      run(func.sectionTOGGLE);
      break;
    case 'herbEDIT':
      run(func.showdownINIT);
      run(func.markdown);
      run(func.highlightCATEGORIES);
      run(func.nameFILL);
      run(func.uploadImagePREVIEW);
      run(func.itemACTION, 'herbs'); // delete or save Herb or Category
      run(func.sectionTOGGLE);
      break;
    case 'herbsSHOW':
      run(func.listFilter, 'herbsSHOW');
      break;
    case 'categoryEDIT':
      run(func.uploadImagePREVIEW);
      run(func.itemACTION, 'categories'); // delete or save Herb or Category
      break;
    case 'categoryNEW':
      run(func.uploadImagePREVIEW);
      run(func.itemACTION, 'herbs'); // delete or save Herb or Category
      break;
  }
}

////////////////////////////////////////////////////////////////////////// Init
//-----------------------------------------------------------------------------
document.addEventListener('DOMContentLoaded', function() {
  getWindowDimensions();
  recCurrPage();
  Engage();
});
